import styled from "styled-components";



export const Body = styled.div`
    background-color: black;
    width: 100%;
    height: 100vh;
    display: flex;
    justify-content: center;
    align-items: center;

`

export const CardLogin = styled.div`
    height: 300px;
    width: 300px;

`
